  ,\n\t\"PspPerInsertDt\",\n\t\"State\",\n\t\"PublishDate\",\n\t\"PspPerDeleteDt\"\
  ,\n\t\"SysTags\",\n\t\"DvParentModel\",\n\t\"ParentModel\",\n\t\"DvState\",\n\t\"\
  PspPerUpdateDt\",\n\t\"SysId\",\n\t\"SysCreatedBy\",\n\t\"Name\",\n\t\"CatalogRequest\"\
  ,\n\t\"SysUpdatedOn\",\n\t\"Uri\",\n\t\"SysModCount\"\n) as\n -- SEMANTIC LAYER\
  \ BEGINS\n\nSELECT \"NUMBER\" as \"Number\",\n       \"SYS_CREATED_ON\" as \"SysCreatedOn\"\
  ,\n       \"NAME_SPACE\" as \"NameSpace\",\n       \"SYS_UPDATED_BY\" as \"SysUpdatedBy\"\
  ,\n       \"DV_CATALOG_REQUEST\" as \"DvCatalogRequest\",\n       \"PSP_PER_INSERT_DT\"\
  \ as \"PspPerInsertDt\",\n       \"STATE\" as \"State\",\n       \"PUBLISH_DATE\"\
  \ as \"PublishDate\",\n       \"PSP_PER_DELETE_DT\" as \"PspPerDeleteDt\",\n   \
  \    \"SYS_TAGS\" as \"SysTags\",\n       \"DV_PARENT_MODEL\" as \"DvParentModel\"\
  ,\n       \"PARENT_MODEL\" as \"ParentModel\",\n       \"DV_STATE\" as \"DvState\"\
  ,\n       \"PSP_PER_UPDATE_DT\" as \"PspPerUpdateDt\",\n       \"SYS_ID\" as \"\
  SysId\",\n       \"SYS_CREATED_BY\" as \"SysCreatedBy\",\n       \"NAME\" as \"\
  Name\",\n       \"CATALOG_REQUEST\" as \"CatalogRequest\",\n       \"SYS_UPDATED_ON\"\
  \ as \"SysUpdatedOn\",\n       \"URI\" as \"Uri\",\n       \"SYS_MOD_COUNT\" as\
  \ \"SysModCount\"\nFROM \"RDS\".\"HI\".\"X_SNC_TAXONOMY_SYS_MODEL\";"
